export const getUserAppMetadataRequest = function(){
  return {
    type: "GET_USER_APP_METADATA_REQUEST"
  }
}

export const getUserAppMetadataSuccess = function(app_metadata) {
  return {
    type: "GET_USER_APP_METADATA_SUCCESS",
    app_metadata
  }
}

export const getUserAppMetadataError = function() {
  return {
    type: "GET_USER_APP_METADATA_ERROR"
  }
}
